// src/pages/HomePage.js

import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div className="container">
            <h1>Welcome!</h1>
            <p>Please <Link to="/login" className="link">log in</Link> or <Link to="/register" className="link">register</Link>.</p>
        </div>
    );
};

export default HomePage;
